import React from 'react';
import './App.css';
import Main from './Main.js';
import Navigation from './Navbar';
import About from './About';
import Services from './Services';
import Contact from './Contact';

function App() {
  return (
    <div className="App">
      <Navigation />
      <Main />
      <About />
      <Services />
      <Contact />
    </div>
  );
}

export default App;
